import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios'
import { BrowserRouter, Routes ,Route, Link } from 'react-router-dom';
import ReactDOM from "react-dom/client";
//import LoginPage from "./LoginPage"
import Layout from "./components/Layout";
import Home from "./components/Home";
import DbTestComponent from "./components/DbTestComponent";
import Contact from "./components/Contact";
import NoPage from "./components/NoPage";
import LoginPage from "./components/LoginPage";
import LogoutButton from "./components/LogoutButton";
import Register from "./components/Register";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { solid, regular, light, thin, duotone, icon } from '@fortawesome/fontawesome-svg-core/import.macro' // <-- import styles to be used


function App() {
  function handleLogin(isLoggedIn: boolean) {
    console.log('Logged in:', isLoggedIn);
    // Do something with the logged-in state
  }

  return (
    <>
    <div className="flex">
    <div className={'w-72 h-screen bg-dark-green'}>
      <ul>
        <li>
          <Link to="/" >
            <FontAwesomeIcon icon={icon({name: 'house', family: 'sharp', style: 'light'})} size="3x" />
          </Link>
        </li>
        <li>
          <Link to="/login" >
            <FontAwesomeIcon icon={icon({name: 'key', family: 'sharp', style: 'light'})} size="3x" />
          </Link>
        </li>
      </ul>
    </div>
    <div className="p-7 text-2x1 font-semibold flex-1 h-screen">
      <h1>Home Page</h1>
    </div>
  </div>
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<Layout />}>
              <Route index element={<Home />} />
              <Route path="api/data" element={<DbTestComponent name="Jaden" />} />
              <Route path="contact" element={<Contact />} />
              <Route path="*" element={<NoPage />} />
              <Route path="/login" element={<LoginPage onLogin={handleLogin}/>} />
              <Route path="api/register" element={<Register />} />
            </Route>
          </Routes>
    </BrowserRouter>
  </>
  );
}

export default App;
